import React from 'react'
import JsonData from '../teams.json'

 function JsonDataDisplay(){
    const DisplayData=JsonData.map(
        (team)=>{
            return(
                <tr>
                    <td>{team.LeagueID}</td>
                    <td>{team.Name}</td>
                    <td>{team.OddsetName}</td>
                    <td>{team.TV4Name}</td>
                </tr>
            )
        }
    )

    return(
        <div>
            <table class="table table-striped">
                <thead>
                    <tr>
                    <th>LeagueID</th>
                    <th>Name</th>
                    <th>Odds Name</th>
                    <th>TV4Name</th>
                    </tr>
                </thead>
                <tbody>


                    {DisplayData}

                </tbody>
            </table>

        </div>
    )
 }

 export default JsonDataDisplay;
